drop table if exists #base

; with cte as 
(select 
 rn = cast(id as int) 
 , grp_ID = (cast(id as int) - 1) / 7 + 1
 , r = (cast(id as int) - 1) % 7 + 1 
 , c = 1
 , ch = left(col, 1)
 , rem = right(col, len(col) - 1)
 from #input

union all 

select 
rn
, grp_ID
, r 
, c+1
, ch = left(rem, 1)
, rem = right(rem, len(rem) - 1)
from cte 
where len(rem) > 0
)
select rn, grp_ID, r, c , ch
into #base from cte 
option (maxrecursion 0)


drop table if exists #KL_height

select b.*
, _bin.KL
, height = sum(case when ch = '#' then 1 else 0 end) over (partition by grp_ID, c) - 1 
into #KL_height
from #base b 
 cross apply
  (select KL = iif(b2.ch = '.', 'L', 'K' ) 
  from #base b2 
  where b2.grp_ID = b.grp_ID 
  and b2.r = 1 
  and b2.c =1 ) _bin


drop table if exists #pairs 

; with keys as 
(select distinct key_ID = grp_ID,  KL,  key_c = C, key_height = height from #KL_height where KL = 'K')
, locks as 
(select distinct lock_ID = grp_ID, KL, lock_c = C, lock_height= height from #KL_height where KL = 'L')
select 
k.key_ID
, l.lock_ID
, cnt_key_c = count(k.key_c)
, cnt_lock_c = count(l.lock_c)
into #pairs
from keys k inner join locks l 
on k.key_c = l.lock_c
and k.key_height + l.lock_height <= 5 
group by 
k.key_ID
, l.lock_ID

-- 3395 
select res = count(*) 
from #pairs 
where cnt_key_c = 5 and cnt_lock_c = 5 



